import logo from './logo.svg';
import './App.css';
import {Route, Switch} from 'react-router-dom';
import Welcome_page from "./windows/welcom_page";

function App() {
  return (
      <Switch>
        <Route exact path='/'>
          <Welcome_page/>
        </Route>
      </Switch>
  );
}

export default App;
